custom_css:
.image-row {
    display: flex;
    justify-content: space-between;
    margin: 0 -5px; /* Add negative margin to counteract container spacing */
  }

  .image-container {
    flex: 1;
    padding: 0 5px; /* Add padding to create spacing between images */
    text-align: center;
  }

  .image-container img {
    max-width: 100%;
    height: auto;
  }
.image-container img {
    max-width: 100%;
    height: auto;
    transition: transform 0.3s ease-in-out;
  }

  .image-container:hover img {
    transform: scale(0.9); 
  }

.video-container {
    position: relative;
    max-width: 100%;
  }

  .video {
    width: 100%;
    height: auto;
  }

  .overlay-text {
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    font-size: 22px;
    color: white;
    text-shadow: 2px 2px 4px rgba(0, 0, 0, 0.7);
    text-align: center;
  }
.overlay-text h2 {
    margin: 0;
